import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <header className="navbar">
        <Navbar />
      </header>

      <main>
        <section className="hero">
          <div className="hero-inner">
            <h1>Welcome to Cafe 4080</h1>
            <p>Where every cup tells a story.</p>
          </div>
        </section>

        <section className="content">
          <h2>Our Story</h2>
          <p>
            This is a small React-wrapped version of the original static site.
            Navbar and Footer were converted to React components so the app
            can run under Create React App.
          </p>
        </section>
      </main>

      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default App;
